import SkillComponents from './skillComponents'



const SkillList = () => {




    let listofskill=[

        {
            "icon":"FaCode",
            "title":"Sprachen",
            "desc":"HTML CSS und Javascript Front to back including  REST api, npm, mit grundlegenden Kenntnissen in jQuery, SASS und PHP und mysql.",
            "animation":"left"
        },
        {
            "icon":"FaReact",
            "title":"Frameworks",
            "desc":"Hands on libraries and frameworks like React.js, Redux, Bootstrap",
            "animation":"left"
        },
        {
            "icon":"MdDevicesOther",
            "title":"Responsive Design",
            "desc":"For me website that is responisve is professional, Therefor I use CSS3 Media Queries or bootstrap to make my websites fully responsive for all devices.",
            "animation":"right"
        },
        {
            "icon":"FaTools",
            "title":"Tools & Apps",
            "desc":"Git and Github",
            "animation":"right"
        }



    ];


    const handleShowStripe = () => (
    listofskill.map((skill)=>(


       <SkillComponents

        icon={skill.icon}
        title={skill.title}
        desc={skill.desc}
        direction={skill.animation}
        >


        </SkillComponents





        >

    )));

    return(
        <div className="skill_wrapper"> <h1 className="projects-section__Heading-sc-1r8qvbm-1 piqbM"><span
            className="SplashText__SplashTextStyles-sc-17ii5cd-0 onayw">Skills</span></h1>

            <div className="skill">    {handleShowStripe()} </div>

        </div>
    )
}

export default SkillList;
